import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Components/Header';
import Footer from './Components/Footer';
import HomePage from './Homepage/HomePage';
import AboutPage from './Aboutpage/AboutPage';
import GalleryPage from './Gallerypage/GalleryPage';
import ProductCard from './Gallerypage/ProductCard';
import DetailPage from './Detailpage/DetailPage';
import ContactPage from './Contactpage/ContactPage';
import LoginWrapper from './Homepage/LoginWrapper';
import RegisterForm from './Homepage/RegisterForm';
import products from './products'; // Импортируем продукты
import './Styles/App.css';

const App = () => (
  <Router>
    <div className="app">
      <Header />
      <main>
        <Routes>
          <Route path="/" element={<HomePage products={products} />} />
          <Route path="/about" element={<AboutPage />} />
          <Route path="/gallery" element={<GalleryPage products={products} />} />
          <Route path="/product/:id" element={<ProductCard products={products} />} />
          <Route path="/product/:id" element={<DetailPage />} />
          <Route path="/contact" element={<ContactPage />} />
          <Route path="/login" element={<LoginWrapper />} />
          <Route path="/register" element={<RegisterForm />} />
        </Routes>
      </main>
      <Footer />
</div>
</Router>
);
export default App;
